children.description:
Upload a local directory to a USS directory.

An optional .zosattributes file in the source directory can be used to control file conversion and tagging.

An example .zosattributes file:{{space}}{{space}}
# pattern        local-encoding        remote-encoding{{space}}{{space}}
# Don't upload the node_modules directory{{space}}{{space}
node_modules     -{{space}}{{space}
# Don't upload files that start with periods{{space}}{{space}}
.*               - {{space}}{{space}
# Upload jpg images in binary{{space}}{{space}}
*.jpg            binary                binary{{space}}{{space}}
# Convert CICS Node.js profiles to EBCDIC{{space}}{{space}}
*.profile        ISO8859-1             EBCDIC{{space}}{{space}}

Lines starting with the ‘#’ character are comments. Each line can specify up to three positional attributes:
{{bullet}} A pattern to match a set of files. Pattern-matching syntax follows the same rules as those that apply in .gitignore files (note that negated patterns that begin with ‘!’ are not supported). See https://git-scm.com/docs/gitignore#_pattern_format.
{{bullet}} A local-encoding to identify a file’s encoding on the local workstation. If '-' is specified for local-encoding,files that match the pattern are not transferred.
{{bullet}} A remote-encoding to specify the file’s desired character set on USS. This attribute must either match the local encoding or be set to EBCDIC. If set to EBCDIC, files are transferred in text mode and converted, otherwise they are transferred in binary mode. Remote files are tagged either with the remote encoding or as binary.

Due to a z/OSMF limitation, files that are transferred in text mode are converted to the default EBCDIC code page on the z/OS system. Therefore the only EBCDIC code page to specify as the remote encoding is the default code page for your system.

A .zosattributes file can either be placed in the top-level directory you want to upload, or its location can be specified by using the --attributes parameter. .zosattributes files that are placed in nested directories are ignored.
